import ExpenseItem from "./ExpenseItem";
import './Expense.css';
export default function Expense(pro){
    
    return(
        <div className="expenses ">
        <ExpenseItem title={proexpenses[0].title} amount={proexpenses[0].amount} date={proexpenses[0].date}></ExpenseItem>
        <ExpenseItem title={proexpenses[1].title} amount={proexpenses[1].amount} date={proexpenses[1].date}></ExpenseItem>
        <ExpenseItem title={proexpenses[2].title} amount={proexpenses[2].amount} date={proexpenses[2].date}></ExpenseItem>
        <ExpenseItem title={proexpenses[3].title} amount={proexpenses[3].amount} date={proexpenses[3].date}></ExpenseItem>
        </div>
    );
}
